export var FormBackgroundDesign;
(function (FormBackgroundDesign) {
    /**
     * A solid background color dependent on the theme.
     */
    FormBackgroundDesign["Solid"] = "Solid";
    /**
     * Transparent background.
     */
    FormBackgroundDesign["Transparent"] = "Transparent";
})(FormBackgroundDesign || (FormBackgroundDesign = {}));
